import React from 'react';
import { motion } from 'framer-motion';
import { ArrowRight } from 'lucide-react';

const Hero = () => {
  return (
    <section className="hero">
      <div className="container">
        <motion.div 
          className="hero-content"
          initial={{ opacity: 0, y: 50 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
        >
          <motion.h1 
            className="hero-title"
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.4 }}
          >
            AI Agent for Developers
          </motion.h1>

          <motion.div 
            className="hero-visual"
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.6 }}
          >
            <div className="tablet-device">
              <div className="tablet-screen">
                <div className="screen-content">
                  <div className="terminal-header">
                    <span className="terminal-title">Llamaware Terminal</span>
                    <div className="mode-indicator">
                      <span>Offline Mode</span>
                    </div>
                  </div>
                  <div className="terminal-content">
                    <div className="command-line">
                      <span className="prompt">Choose mode [1=Online / 2=Offline]:</span>
                      <span className="input">2</span>
                    </div>
                    <div className="status-line">
                      <span className="status">Offline mode: llama3.2</span>
                    </div>
                    <div className="command-line">
                      <span className="prompt">›</span>
                      <span className="input">help</span>
                    </div>
                    <div className="help-output">
                      <div className="output-line">=== Available Commands ===</div>
                      <div className="output-line">• search:query - Search the web</div>
                      <div className="output-line">• cmd:command - Execute shell command</div>
                      <div className="output-line">• read:filename - Read file contents</div>
                      <div className="output-line">• write:file content - Write to file</div>
                    </div>
                    <div className="command-line">
                      <span className="prompt">›</span>
                      <span className="input">cmd:ls -la</span>
                    </div>
                    <div className="command-output">
                      <div className="output-line">[Executing]: ls -la</div>
                      <div className="output-line">total 48</div>
                      <div className="output-line">drwxr-xr-x 12 user staff 384 Jan 28 10:30 .</div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </motion.div>

          <motion.div 
            className="hero-actions"
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.8 }}
          >
            <a href="#features" className="btn btn-primary">
              Get Started
              <ArrowRight size={16} />
            </a>
          </motion.div>
        </motion.div>
      </div>

      <style jsx>{`
        .hero {
          min-height: 100vh;
          display: flex;
          align-items: center;
          position: relative;
          background: #ffffff;
          text-align: center;
          padding: 120px 0;
        }

        .hero-content {
          max-width: 1000px;
          margin: 0 auto;
        }

        .hero-title {
          font-family: 'Georgia', 'Times New Roman', serif;
          font-size: 4.5rem;
          font-weight: 400;
          color: #1a202c;
          margin-bottom: 80px;
          line-height: 1.05;
          letter-spacing: -0.025em;
        }

        .hero-visual {
          margin-bottom: 60px;
          display: flex;
          justify-content: center;
        }

        .tablet-device {
          width: 400px;
          height: 280px;
          background: #000000;
          border-radius: 20px;
          padding: 8px;
          box-shadow: 0 20px 40px rgba(0, 0, 0, 0.1);
          transform: rotate(-5deg);
        }

        .tablet-screen {
          width: 100%;
          height: 100%;
          background: #1a202c;
          border-radius: 12px;
          padding: 20px;
          position: relative;
          overflow: hidden;
        }

        .screen-content {
          height: 100%;
          display: flex;
          flex-direction: column;
        }

        .terminal-header {
          display: flex;
          justify-content: space-between;
          align-items: center;
          margin-bottom: 20px;
        }

        .terminal-title {
          font-size: 0.8rem;
          color: rgba(255, 255, 255, 0.8);
          font-weight: 500;
        }

        .mode-indicator {
          background: rgba(56, 161, 105, 0.2);
          padding: 4px 8px;
          border-radius: 12px;
          font-size: 0.6rem;
          color: #38a169;
          font-weight: 500;
        }

        .terminal-content {
          flex: 1;
          display: flex;
          flex-direction: column;
          gap: 8px;
          font-family: 'JetBrains Mono', monospace;
          font-size: 0.7rem;
          line-height: 1.4;
        }

        .command-line {
          display: flex;
          align-items: center;
          gap: 8px;
        }

        .prompt {
          color: #38a169;
          font-weight: 600;
        }

        .input {
          color: rgba(255, 255, 255, 0.9);
          font-weight: 400;
        }

        .status-line {
          color: #38a169;
          font-weight: 500;
          margin-bottom: 8px;
        }

        .help-output {
          display: flex;
          flex-direction: column;
          gap: 2px;
          margin-bottom: 8px;
        }

        .command-output {
          display: flex;
          flex-direction: column;
          gap: 2px;
        }

        .output-line {
          color: rgba(255, 255, 255, 0.8);
          font-weight: 400;
        }

        .hero-actions {
          display: flex;
          justify-content: center;
        }

        @media (max-width: 768px) {
          .hero {
            padding: 80px 0;
          }

          .hero-title {
            font-size: 3rem;
            margin-bottom: 60px;
          }

          .tablet-device {
            width: 300px;
            height: 210px;
          }
        }

        @media (max-width: 480px) {
          .hero-title {
            font-size: 2.5rem;
            margin-bottom: 40px;
          }

          .tablet-device {
            width: 250px;
            height: 175px;
          }
        }
      `}</style>
    </section>
  );
};

export default Hero;
